import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import { Parallax, ParallaxBanner } from 'react-scroll-parallax';
import Image from 'react-bootstrap/Image';



function MainSlider() {
  return (
      <div className="slider">
        <Carousel

        >
          <Carousel.Item>
          <Parallax className="slide_img" y={[-20, 20]} tagOuter="figure">
       <img src="/images/slides/slide_2.png" />
   </Parallax>
          </Carousel.Item>


          <Carousel.Item>
          <ParallaxBanner
          className="slide_img"
            layers={[
                {
                    image: '/images/slides/slide_2.png',
                    amount: 0.65,
                },
            ]}
            style={{
                textAlign: 'center',
                margin: '0',
            }}
          >

        </ParallaxBanner>
          </Carousel.Item>


          <Carousel.Item>
          <ParallaxBanner
          className="slide_img"
            layers={[
                {
                    image: '/images/slides/slide_2.png',
                    amount: 0.65,
                },
            ]}
            style={{
                textAlign: 'center',
                margin: '0',
            }}

          >

        </ParallaxBanner>
          </Carousel.Item>
        </Carousel>
      </div>
  );
}

export default MainSlider;
